    data: |
      SELECT cor0.col2 + - cor0.col2 * - CAST ( cor0.col2 * - cor0.col2 - cor0.col2 AS INTEGER ) FROM tab0 AS cor0 GROUP BY cor0.col1, cor0.col2;
  - name: tab0

outputs:
  - name: q199.out
    data: |
      -14376
      -499201
      -56278
